import React, { useState } from 'react';
import Navbar from '../../components/Navbar';
import Footer from '../../components/Footer';
import Modal from '../../components/Modal';
import Header from '../../components/Header';
import '../../styles/Home.css';

const Home = () => {
    const [isModalOpen, setIsModalOpen] = useState(false);

    return (
        <div className="home">
            {/* Navbar always visible */}
            <Navbar openModal={() => setIsModalOpen(true)} />

            {/* Hero Section / Header */}
            <Header />

            {/* Main Content */}
            <div className="home-content">
                <div className="header-section">
                    <h1>Welcome to The Moonâ€™s Salon</h1>
                    <p>Your one-stop destination for beauty and wellness.</p>
                    <div className="btn-group">
                        <button className="primary-btn">Book an Appointment</button>
                        <button className="secondary-btn">Explore Services</button>
                    </div>
                </div>

                {/* Services Preview */}
                <div className="services-preview">
                    <h2>Our Popular Services</h2>
                    <div className="services-grid">
                        <div className="service">
                            <img src="https://images.unsplash.com/photo-1559599101-f09722fb4948?q=80&w=2669&auto=format&fit=crop" alt="Haircut & Styling"/>
                            <h3>Haircut & Styling</h3>
                            <p>Get the latest trends and styles.</p>
                        </div>
                        <div className="service">
                            <img src="https://images.unsplash.com/photo-1542848284-8afa78a08ccb?q=80&w=2572&auto=format&fit=crop" alt="Massage Therapy"/>
                            <h3>Massage Therapy</h3>
                            <p>Relax and unwind with expert massages.</p>
                        </div>
                        <div className="service">
                            <img src="https://images.unsplash.com/photo-1618328769009-b1a3e561f5e8?q=80&w=2670&auto=format&fit=crop" alt="Manicure & Pedicure"/>
                            <h3>Manicure & Pedicure</h3>
                            <p>Healthy and beautiful nails.</p>
                        </div>
                    </div>
                </div>
            </div>

            {/* Footer */}
            <Footer />

            {/* Modal for Login/Signup */}
            <Modal isOpen={isModalOpen} closeModal={() => setIsModalOpen(false)} />
        </div>
    );
};

export default Home;
